import React from 'react'
import Jumbotron from '../../components/Jumbotron';

function Home()  {
   useEffect(()=>{
      axios.get('https://www.themealdb.com/api/json/v1/1/search.php?f=a')
      .then(({data})=> console.log(data));
  },[])
  return (
    <div>
      <Jumbotron/>
    </div>
  )
}

export default Home;
